Manuel del Palacio (1831-1906) fue un poeta, periodista y satírico español del Realismo. Perteneció a la escuela becqueriana y fue conocido por sus sonetos y composiciones humorísticas. Este soneto titulado "Trabajo perdido" es una de sus obras más conocidas.
